import React from 'react'
import { Card } from 'react-bootstrap'
import Product from './Product'
const Store = () => {
  return (
    <>
      <Card
        className="text-white text-center"
        variant="light"
        style={{
          width: "100%",
          height: "15rem",
          fontSize: "100vw",
          backgroundColor: "grey",
        }}
      >
        The Generics
      </Card>
      <Product/>
    </>
  )
}

export default Store
